import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./styles.scss";

class Support extends Component {
  render() {
    return (
      <div className="container">
        <div className="row">
          <div className="col-12 support-div">
            <div className="row row-cols-3 box">
              <div className="col item">
                <Link to="/global/register" className="text-decoration-none">
                  <img
                    src="https://www.aorus.com/assets/img/mb.4ffdebec.svg"
                    alt=""
                  />
                  <h3 className="text-white">REGISTER PRODUCTS</h3>
                  <p className="decoration font-family-Ti">
                    Login to complete your registration
                  </p>
                </Link>
              </div>
              <div className="col item"></div>
              <div className="col item"></div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

const supports = [
  {
    img: "https://www.aorus.com/assets/img/mb.4ffdebec.svg",
    label: "REGISTER PRODUCTS",
    decoration: "Login to complete your registration",
  },
  {
    img: "https://www.aorus.com/assets/img/support.ea65ce49.svg",
    label: "SERVICE/SUPPORT",
    decoration: "BIOS/Driver/Manual/File download and more",
  },
];

export default Support;
